import React from "react";
import "./App.css";

export default function Navbar() {
  return (
    <div className="Navbar">
      <span className="left">Weather App</span>
      <span className="right">
        <a href="https://github.com/sachin-duhan26">About Me</a>
      </span>
    </div>
  );
}
